import React from "react";
import {
    BrowserRouter,
    Routes,
    Route
} from "react-router-dom";

import ContactsBook from './Contact-components/ContactsBook';
import Todo from './Todo-components/Todo';

import './App.css';


function App() {
  return (
    <BrowserRouter>
          <div className='App'>
            <h1>Home page</h1>
          </div>

            <Routes>
                <Route path='/contacts' component={ContactsBook} />
                <Route path='/todo' component={Todo} />
            </Routes>

    </BrowserRouter>
  );
}

export default App;
